import React from "react";
import { Router, Switch } from "react-router";
import BigArticle from "../subComponents/BigArticle";

function TopicsPage(props) {
   return (
      <Router>
         <Switch>
            <Health />
            <Science />
            <Sports />
            <Entertainment />
            <Business />
            <Technology />
         </Switch>
      </Router>
   );
}

export default TopicsPage;
